import "./Header.css";
import React from "react";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import { Link, animateScroll as scroll } from "react-scroll";

const Header = ({}) => {
  return (
    <>
      <Navbar.Brand href="/">My Logo</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="nav-items ml-auto">
        <a
            className="nav-item"
            activeClass="active"
            href="/#projects"
          >
            Projects
          </a>
          <Link
            className="nav-item"
            activeClass="active"
            to="education"
            spy={true}
            smooth={true}
            offset={-20}
            duration={500}
          >
            Education
          </Link>
          <Link
            className="nav-item"
            activeClass="active"
            to="experience"
            spy={true}
            smooth={true}
            offset={-20}
            duration={500}
          >
            Experience
          </Link>
          <Link
            className="nav-item"
            activeClass="active"
            to="skills"
            spy={true}
            smooth={true}
            offset={-20}
            duration={500}
          >
            Skills
          </Link>
          <Link
            className="nav-item"
            activeClass="active"
            to="achievements"
            spy={true}
            smooth={true}
            offset={-20}
            duration={500}
          >
            Achievements
          </Link>
        </Nav>
      </Navbar.Collapse>
    </>
  );
};

export default Header;
